// Libraries
import React from "react";
import ReactDOM from "react-dom";
import reportWebVitals from './reportWebVitals';

// Style Sheets
import "./maps/styles.css";

// React Elements
import App from "./app/App";
// import MapChart from "./maps/MapChart";
import WorldMap from "./maps/map";
import BasicExample from "./buttons/dropdown"

const rootElement = document.getElementById("root");
ReactDOM.render(<><App /><WorldMap /><BasicExample /></>, rootElement);

// const countryMapElement = document.getElementById("country");
